                //logic to only get the higher priority oid-s
                for (int i = 0; i < oidToGet.Count-1; i++)
                {
                    //Searches for an element that has the same oid name,
                    //and returns the zero-based index of the first occurrence within the entire oidToGet list.
                    int index = oidToGet.FindIndex(o => o.name == oidToGet[i].name && o.id != oidToGet[i].id);
                    if (index < 0)
                        continue;

                    if (oidToGet[i].oidGroup.priority > oidToGet[index].oidGroup.priority)
                    {
                        oidToGet.RemoveAt(index);
                    }
                    else if (oidToGet[i].oidGroup.priority == oidToGet[index].oidGroup.priority)
                    {
                        //only keep
                        if (oidToGet[i].oidGroup.id < oidToGet[index].oidGroup.id)
                        {
                            oidToGet.RemoveAt(index);
                        }
                        else
                        {
                            oidToGet.Remove(oidToGet[i]);
                        }
                    }
                }
